import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import processLogin from '../../form-processing/login';
import { formType } from '../../../globals/constants';
import { canRoute, empRoute, candidate, employer } from '../../../globals/route-names';

function SignInPopup() {
    const navigate = useNavigate();
    const [canUsername, setCanUsername] = useState('');
    const [empUsername, setEmpUsername] = useState('');
    const [password, setPassword] = useState('');

    const handleLogin = (type) => async (event) => {
        event.preventDefault();

        const loginData = {
            username: type === formType.LOGIN_CANDIDATE ? canUsername : empUsername,
            password,
        };

        const formTypeToProcess = type === formType.LOGIN_CANDIDATE
            ? formType.LOGIN_CANDIDATE
            : formType.LOGIN_EMPLOYER;

        processLogin(
            { type: formTypeToProcess, ...loginData },
            (valid) => {
                if (valid) {
                    navigate(
                        type === formType.LOGIN_CANDIDATE
                            ? canRoute(candidate.DASHBOARD)
                            : empRoute(employer.DASHBOARD)
                    );
                } else {
                    console.log('Login failed.');
                }
            }
        );
    };

    return (
        <div className="modal fade twm-sign-up" id="sign_up_popup2" aria-hidden="true" tabIndex={-1}>
            <div className="modal-dialog modal-dialog-centered">
                <div className="modal-content">
                    <div className="modal-header">
                        <h2 className="modal-title">Login</h2>
                        <p>Login and get access to all the features of Jobzilla</p>
                        <button type="button" className="btn-close" data-bs-dismiss="modal" />
                    </div>
                    <div className="modal-body">
                        <div className="twm-tabs-style-2">
                            <ul className="nav nav-tabs" role="tablist">
                                <li className="nav-item">
                                    <button className="nav-link active" data-bs-toggle="tab" data-bs-target="#login-candidate" type="button">
                                        <i className="fas fa-user-tie" /> Candidate
                                    </button>
                                </li>
                                <li className="nav-item">
                                    <button className="nav-link" data-bs-toggle="tab" data-bs-target="#login-Employer" type="button">
                                        <i className="fas fa-building" /> Employer
                                    </button>
                                </li>
                            </ul>
                            <div className="tab-content">
                                {/* Candidate Login */}
                                <form onSubmit={handleLogin(formType.LOGIN_CANDIDATE)} className="tab-pane fade show active" id="login-candidate">
                                    <div className="row">
                                        <div className="col-lg-12 mb-3">
                                            <input
                                                type="text"
                                                className="form-control"
                                                placeholder="Username*"
                                                value={canUsername}
                                                onChange={(e) => setCanUsername(e.target.value)}
                                                required
                                            />
                                        </div>
                                        <div className="col-lg-12 mb-3">
                                            <input
                                                type="password"
                                                className="form-control"
                                                placeholder="Password*"
                                                value={password}
                                                onChange={(e) => setPassword(e.target.value)}
                                                required
                                            />
                                        </div>
                                        <div className="col-md-12">
                                            <button type="submit" className="site-button" data-bs-dismiss="modal">
                                                Log in
                                            </button>
                                        </div>
                                    </div>
                                </form>
                                {/* Employer Login */}
                                <form onSubmit={handleLogin(formType.LOGIN_EMPLOYER)} className="tab-pane fade" id="login-Employer">
                                    <div className="row">
                                        <div className="col-lg-12 mb-3">
                                            <input
                                                type="text"
                                                className="form-control"
                                                placeholder="Username*"
                                                value={empUsername}
                                                onChange={(e) => setEmpUsername(e.target.value)}
                                                required
                                            />
                                        </div>
                                        <div className="col-lg-12 mb-3">
                                            <input
                                                type="password"
                                                className="form-control"
                                                placeholder="Password*"
                                                value={password}
                                                onChange={(e) => setPassword(e.target.value)}
                                                required
                                            />
                                        </div>
                                        <div className="col-md-12">
                                            <button type="submit" className="site-button" data-bs-dismiss="modal">
                                                Log in
                                            </button>
                                        </div>
                                    </div>
                                </form>
                            </div>
                        </div>
                    </div>
                    <div className="modal-footer">
                        <span className="modal-f-title">Login or Sign up with</span>
                        <ul className="twm-modal-social">
                            <li><a href="https://www.facebook.com/" className="facebook-clr"><i className="fab fa-facebook-f" /></a></li>
                            <li><a href="https://www.twitter.com/" className="twitter-clr"><i className="fab fa-twitter" /></a></li>
                            <li><a href="https://in.linkedin.com/" className="linkedin-clr"><i className="fab fa-linkedin-in" /></a></li>
                            <li><a href="https://www.google.com/" className="google-clr"><i className="fab fa-google" /></a></li>
                        </ul>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default SignInPopup;
